import axios from 'axios';


function pokeapi(){
    axios.get('https://pokeapi.co/api/v2/').then(
         response => this.setState({
             pokemons:response
         })
         
         );

   
}
console.log(this.state.pokemons.map)


pokeapi();

export default pokeapi;
